import React from "react";
import Footer from '../Footer/Footer';
import { Link } from "react-router-dom";
import NavBar from '../NavBar/NavBar';
import margotCoachingImg from '../img/MargotCoaching.jpg';

const CoachingComponent = () => {
  return (
    <div>
    	<NavBar/>
    	<h1>Margot Soria</h1>
    	<h2>Le Coaching</h2>
    	<div>

    	</div>	

      <ul>
        {["Alex", "John", "Jaz", "fedrik", "missali","Alex", "John", "Jaz", "fedrik", "missali"].map((user, idx) => {
          return <li key={idx}>{user}</li>;
        })}
      </ul>
      <Link to="/"><h1>Le Coaching</h1></Link>
      <Footer/>
    </div>
  );
};

export default CoachingComponent;
